import React from 'react';

function hello() {
  return (
    <div class="hello">
      <h1>("Name:", this.props.name)</h1>
      <p>("Education:", this.props.name)</p>
      <p>("Email:", this.props.name)</p>
    </div>
  );
}

export default hello;
